import React, { Component } from "react";
import '../../App.css';
import Drawer from '@material-ui/core/Drawer';
import Divider from '@material-ui/core/Divider';


import * as videoStyles from  "../../styles/video";
import drawer from "../../styles/drawer";


class Home extends Component {

    constructor(props){
        super(props);       
    }
 
  


    render() {
             
        return (
        <>
        <Drawer className={drawer} variant="permanent" anchor="left">

        </Drawer>    
        <div style={videoStyles.videoContainer} >
           <iframe style={videoStyles.video} width="700" height="400" src="https://295-videos.s3.us-east-2.amazonaws.com/San-Jose-16th-Oct-2019.mp4"></iframe>
        </div>
        </> 

        );
    }
}



export default Home;
